// Realistic high-contrast volumetric clouds
// FBM noise + ray marching through cloud layer

float hash(vec2 p) {
    return fract(sin(dot(p, vec2(127.1, 311.7))) * 43758.5453);
}

float noise(vec2 p) {
    vec2 i = floor(p);
    vec2 f = fract(p);
    f = f * f * (3.0 - 2.0 * f);
    float a = hash(i);
    float b = hash(i + vec2(1.0, 0.0));
    float c = hash(i + vec2(0.0, 1.0));
    float d = hash(i + vec2(1.0, 1.0));
    return mix(mix(a, b, f.x), mix(c, d, f.x), f.y);
}

float fbm(vec2 p) {
    float v = 0.0;
    float a = 0.5;
    mat2 rot = mat2(0.8, 0.6, -0.6, 0.8);
    for (int i = 0; i < 7; i++) {
        v += a * noise(p);
        p = rot * p * 2.0;
        a *= 0.5;
    }
    return v;
}

float hash3(vec3 p) {
    return fract(sin(dot(p, vec3(127.1, 311.7, 74.7))) * 43758.5453);
}

float noise3(vec3 p) {
    vec3 i = floor(p);
    vec3 f = fract(p);
    f = f * f * (3.0 - 2.0 * f);
    float n = mix(
        mix(mix(hash3(i), hash3(i + vec3(1,0,0)), f.x),
            mix(hash3(i + vec3(0,1,0)), hash3(i + vec3(1,1,0)), f.x), f.y),
        mix(mix(hash3(i + vec3(0,0,1)), hash3(i + vec3(1,0,1)), f.x),
            mix(hash3(i + vec3(0,1,1)), hash3(i + vec3(1,1,1)), f.x), f.y),
        f.z);
    return n;
}

float fbm3(vec3 p) {
    float v = 0.0;
    float a = 0.5;
    for (int i = 0; i < 6; i++) {
        v += a * noise3(p);
        p = p * 2.02 + vec3(1.3, 2.7, 0.5);
        a *= 0.5;
    }
    return v;
}

float cloudDensity(vec3 p) {
    float t = iTime * 0.03;
    p.xz += t * 8.0;
    float d = fbm3(p * 0.3);
    d = smoothstep(0.35, 0.7, d);
    // Shape falloff based on height
    float hFalloff = 1.0 - smoothstep(0.0, 1.0, abs(p.y - 5.0) / 3.0);
    return d * hFalloff;
}

vec3 sunDir = normalize(vec3(0.6, 0.35, -0.5));

void mainImage(out vec4 fragColor, in vec2 fragCoord) {
    vec2 uv = (fragCoord - 0.5 * iResolution.xy) / iResolution.y;

    // Camera
    vec3 ro = vec3(0.0, 3.0, 0.0);
    vec3 rd = normalize(vec3(uv.x, uv.y + 0.15, -1.0));

    // Sky gradient - deep blue to pale horizon
    float skyGrad = max(rd.y, 0.0);
    vec3 skyCol = mix(vec3(0.7, 0.75, 0.85), vec3(0.15, 0.3, 0.65), pow(skyGrad, 0.5));

    // Sun
    float sunDot = max(dot(rd, sunDir), 0.0);
    skyCol += vec3(1.0, 0.9, 0.7) * pow(sunDot, 256.0) * 2.0;
    skyCol += vec3(1.0, 0.7, 0.4) * pow(sunDot, 32.0) * 0.3;
    skyCol += vec3(0.8, 0.6, 0.3) * pow(sunDot, 4.0) * 0.1;

    // Ray march through cloud layer
    vec3 col = skyCol;

    if (rd.y > -0.01) {
        float cloudBase = 3.5;
        float cloudTop = 8.5;

        float tMin = (cloudBase - ro.y) / max(rd.y, 0.001);
        float tMax = (cloudTop - ro.y) / max(rd.y, 0.001);
        tMin = max(tMin, 0.0);
        tMax = min(tMax, 200.0);

        float transmittance = 1.0;
        vec3 lightEnergy = vec3(0.0);

        int steps = 48;
        float dt = (tMax - tMin) / float(steps);

        for (int i = 0; i < 48; i++) {
            float t = tMin + (float(i) + 0.5) * dt;
            vec3 p = ro + rd * t;

            float density = cloudDensity(p);

            if (density > 0.01) {
                // Light marching toward sun for shadows
                float lightDensity = 0.0;
                vec3 lp = p;
                for (int j = 0; j < 4; j++) {
                    lp += sunDir * 1.5;
                    lightDensity += cloudDensity(lp);
                }

                float lightTransmit = exp(-lightDensity * 2.5);

                // High contrast lighting
                vec3 sunLight = vec3(1.0, 0.92, 0.8) * 2.5;
                vec3 ambient = mix(vec3(0.25, 0.3, 0.45), vec3(0.05, 0.05, 0.12), density);

                // Silver lining / rim light effect
                float phase = 0.5 + 0.5 * sunDot;
                float hg = (1.0 - 0.6*0.6) / (4.0 * 3.14159 * pow(1.0 + 0.6*0.6 - 2.0*0.6*sunDot, 1.5));

                vec3 cloudLight = sunLight * lightTransmit * (hg * 0.7 + 0.3) + ambient;

                // Beer's law absorption with high contrast
                float absorption = density * dt * 3.0;
                float absorbed = 1.0 - exp(-absorption);

                lightEnergy += transmittance * cloudLight * absorbed;
                transmittance *= exp(-absorption);

                if (transmittance < 0.01) break;
            }
        }

        col = lightEnergy + transmittance * skyCol;
    }

    // Tone mapping for high contrast
    col = pow(col, vec3(1.1)); // Boost contrast
    col = col / (1.0 + col); // Reinhard
    col = pow(col, vec3(0.42)); // Gamma

    // Slight vignette for drama
    vec2 vuv = fragCoord / iResolution.xy;
    col *= 1.0 - 0.3 * dot(vuv - 0.5, vuv - 0.5);

    fragColor = vec4(col, 1.0);
}

